import React from 'react';
import myGif from '../images/logo.gif'; // Adjust the path to your GIF file

const GifComponent = () => {
  return (
    <div>
      <h2>Check out this GIF!</h2>
      <img src={myGif} alt="My GIF" />
    </div>
  );
};

export default GifComponent;
